import React from "react";
import "./transactionPage.css";
import axios from "axios";
import { useEffect, useState } from "react";

const Transaction = (account) => {
    return (
        <tr>
            <td>{account.name}</td>
            <td>{account.subtype}</td>
            <td>{account.balance.current}</td>
        </tr>
    );
};

const TransactionPage = async () => {
    const [page, setPage] = useState(0);
    const [accounts, setAccounts] = useState([]);

    await axios
        .post("/balance", {
            access_token: "access-sandbox-4acad0a3-4e55-4ecc-8a16-8114123c22c4",
        })
        .then((res) => {
            setAccounts(res);
        });

    const transactionList = (page) => {
        console.log("acc");
        console.log(accounts);
        return accounts.map((currentAccount) => {
            return <Transaction account={currentAccount} />;
        });
    };

    return (
        <div id="background">
            <div id="container">
                <table>
                    <thead>
                        <tr>
                            <th>Institution Name</th>
                            <th>Account Type</th>
                            <th>Balance</th>
                        </tr>
                    </thead>
                    <tbody>{transactionList()}</tbody>
                </table>
            </div>
        </div>
    );
};

export default TransactionPage;
